			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Possible Project Specific Environments\ndeclare -a POSSIBLE_CONFIGURATIONS=(\"phi\" \"billing\" \"payments\" \"mma\" \"hotfix\")\n\n# Get current git branch\ngit_version=$(git log -1 --format=\"%h\")\ngit_branch=$(git symbolic-ref --short -q HEAD)\n\necho $git_branch\n# Entry in plist to be updated\nplistEntryName=\"Project\\ Environment\\ Prefix\"\n\n# If git branch contains substring of possible project specific env's edit plist for PROJECT_PREFIX\nif [[ $git_branch == *\"phi\"* ]]; then\n  /usr/libexec/PlistBuddy -c \"Set :$plistEntryName /phimobile\" \"${TARGET_BUILD_DIR}/${INFOPLIST_PATH}\"\n  echo \"EUMobile Project Environment Prefix set: /phimobile\"\nelif [[ $git_branch == *\"billing\"* ]]; then\n  /usr/libexec/PlistBuddy -c \"Set :$plistEntryName /billing\" \"${TARGET_BUILD_DIR}/${INFOPLIST_PATH}\"\n  echo \"EUMobile Project Environment Prefix set: /billing\"\nelif [[ $git_branch == *\"payments\"* ]]; then\n  /usr/libexec/PlistBuddy -c \"Set :$plistEntryName /paymentenhancements\" \"${TARGET_BUILD_DIR}/${INFOPLIST_PATH}\"\n  echo \"EUMobile Project Environment Prefix set: /paymentenhancements\"\nelif [[ $git_branch == *\"mma\"* ]]; then\n  /usr/libexec/PlistBuddy -c \"Set :$plistEntryName /manage-my-account\" \"${TARGET_BUILD_DIR}/${INFOPLIST_PATH}\"\n  echo \"EUMobile Project Environment Prefix set: /manage-my-account\"\nelif [[ $git_branch == *\"hotfix\"* ]]; then\n  /usr/libexec/PlistBuddy -c \"Set :$plistEntryName /hotfix\" \"${TARGET_BUILD_DIR}/${INFOPLIST_PATH}\"\n  echo \"EUMobile Project Environment Prefix set: /hotfix\"\nelse\n  echo \"No Project Environment Prefix set due to git path: $git_branch\"\nfi\n";
